I think WebUtil.getRequestUrl() should ensure proper URL encoding:

bc..	public static String getRequestPath(String repositoryUrl) {
		int colonSlashSlash = repositoryUrl.indexOf("://"); //$NON-NLS-1$
		int requestPath = repositoryUrl.indexOf('/', colonSlashSlash + 3);

		if (requestPath < 0) {
			return ""; //$NON-NLS-1$
		} else {
			String request = repositoryUrl.substring(requestPath);
			try {
				return URLEncoder.encode(request, "UTF-8"); //$NON-NLS-1$
			} catch (UnsupportedEncodingException e) {
			}
		}
		return ""; //$NON-NLS-1$
	}
